sys_variable_value.value:
(function execute(inputs, outputs) {
  var response = JSON.parse(inputs.responsebody);

  if(inputs.statusCode == "200")
  {
    var appNames = [];
    for(var n=0; n<response.result.length; n++)
    {
      appNames.push(response.result[n].name+":"+response.result[n].sys_id+":"+response.result[n].version+":"+response.result[n].scope);
    }
    outputs.statuscode = "0";
    outputs.appnames = appNames;
  } 
  else 
  {
    outputs.statuscode = "1";
    outputs.error = inputs.errorMessage;
  }
})(inputs, outputs);

